import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
  appBar: {
    borderRadius: 15,
    margin: '30px 0',
    display: 'flex',
    flexDirection: 'row',
    backgroundColor: '#000957',
    paddingBottom: "5px",
  },
  heading: {
    color: '#fff',
  },
  image: {
    marginLeft: '15px',
  },
}));
